const breedImages = {
    "Labrador": "data:image/jpeg;base64,",
    "Bulldog": "data:image/jpeg;base64,",
    "Beagle": "data:image/jpeg;base64,",
    "Poodle": "data:image/jpeg;base64,",
    "Rottweiler": "data:image/jpeg;base64,",
    "Pastor Alemán": "data:image/jpeg;base64,",
    "Golden Retriever": "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQhNmAzA80LJKrPp6cZ2ztADcIeHc2p4BH8u60H2O8wlwurSoCdSbik&usqp=CAE&s",
    "Chihuahua": "data:image/jpeg;base64,",
    "Husky": "data:image/jpeg;base64,",
    "Doberman": "https://encrypted-tbn0.gstatic.com/licensed-image?q=tbn:ANd9GcR2etGo4z0dT4UsBN22w9Kb2jM1fQbMxv7oqeGPl3da-zSoeC4z_1rmGp8PZpU2d5Ny7Trxia9k&s=19"
};

document.getElementById('add-pet-button').addEventListener('click', function() {
    document.getElementById('new-pet-form').style.display = 'block';
});

document.getElementById('new-pet-form').addEventListener('submit', function(event) {
    event.preventDefault();
    
    const name = document.getElementById('pet-name').value;
    const age = document.getElementById('pet-age').value;
    const breed = document.getElementById('pet-breed').value;
    const weight = document.getElementById('pet-weight').value;
    const imageUrl = breedImages[breed];

    const newCard = document.createElement('div');
    newCard.className = 'card';
    newCard.innerHTML = `
        <h2>${name}</h2>
        <img src="${imageUrl}" alt="${breed}" class="pet-image">
        <p><strong>Edad:</strong> ${age} años</p>
        <p><strong>Raza:</strong> ${breed}</p>
        <p><strong>Peso:</strong> ${weight} kg</p>
    `;

    document.querySelector('.cards-container').appendChild(newCard);
    document.getElementById('new-pet-form').reset();
    document.getElementById('new-pet-form').style.display = 'none';
});


document.getElementById('new-pet-form').addEventListener('submit', (e) => {
    e.preventDefault();
    const name = document.getElementById('pet-name').value;
    const age = document.getElementById('pet-age').value;
    const breed = document.getElementById('pet-breed').value;
    const weight = document.getElementById('pet-weight').value;
    const user = auth.currentUser;

    if (user) {
        db.collection('pets').add({
            name: name,
            age: age,
            breed: breed,
            weight: weight,
            owner_id: user.uid
        })
        .then(() => {
            alert('Pet added successfully');
        })
        .catch((error) => {
            alert('Error adding pet: ' + error.message);
        });
    } else {
        alert('No user is signed in');
    }
});